import React from 'react';

function Home() {
  return (
    <div style={{ padding: '2rem' }}>
      <h1>Welcome to Appointment Booking System</h1>
      <p>Please select an option from the navigation menu to get started.</p>
    </div>
  );
}

export default Home;
